		<title>Simple Line Graph using SVG and d3.js</title>
		<script src="d3/d3.min.js"></script>
		<style>
			/* tell the SVG path to be a thin blue line without any area fill */
            #bluen
            {
                display: inline-block; 
                margin-top: 0.5em; 
                margin-bottom: 0.5em;
                margin-left: auto;
                margin-right: auto;
                border-style: inset;
                border-width: 1px;
                border-color: steelblue;
                width: 50px;

            } 
            #redn
            { 
                display: inline-block;
                margin-top: 0.5em;
                margin-bottom: 0.5em;
                margin-left: auto;
                margin-right: auto;
                border-style: inset;
                border-width: 1px;
                border-color: red;
                width: 50px;
            }
			path {
				stroke: steelblue;
				stroke-width: 2;
				fill: none;
			}
            div.tooltip {	
                position: absolute;			
                text-align: center;			
                width: 90px;					
                height: 28px;					
                padding: 2px;				
                font: 12px sans-serif;		
                background: lightsteelblue;	
                border: 0px;		
                border-radius: 8px;			
                pointer-events: none;			
            }

			
			.axis {
			  shape-rendering: crispEdges;
			}

			.x.axis line {
			  stroke: lightgrey;
			}

			.x.axis .minor {
			  stroke-opacity: .5;
			}

			.x.axis path {
			  display: none;
			}
			.x.axis path1 {
			  display: none;
			}
			.y.axis line, .y.axis path,.y.axis path1 {
			  fill: none;
			  stroke: #000;
			}
		</style>
